This afternoon, I had the honor, together with fmr. Congressman Edolphus Towns, to meet with Rep. G. Meeks (D-NY-5), the Ranking Member of the House Foreign Relations Committee. We focused on Ethio-US and US-Africa relations wrt development, investment, AGOA, trade and investment. 

Thank you for the time and your vision and commitment on the US role in Africa’s transformation.

@RepGregoryMeeks @mfaethiopia

Honored and grateful to meet with Sen. Mike Rounds (R-SD) today. We have discussed US-Ethiopia relation, AGOA and trade, implementation of Pretoria peace agreement and humanitarian support
#Ethiopia-USA diplomatic relation was established 120 years ago, useful economic relationship such as in aviation industry, coffee, textile  trades are expanding. 100s of thousands of Ethiopian diaspora live in USA and now it is timely to promote the relationship to strategic partners level. Congress may support such endeavors 
@mfaethiopia .
